  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). The weather in 1967 was cool and dry with the exception
  of the summer months. Overall aquatic plant production was good and somewhat better
  than last year. Despite good production the spring migrants were reluctant to stay
  long due to frozen ponds.  Much of the maintenance on the refuge was spent reshaping
  and raising canal banks. Roads were graded, graveled and picked for large rocks
  and public use facilities were improved. Tamarisk is still posing a problem to the
  refuge due to the dry conditions of the year.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
